css:
.editor-colors,
:host {
  background-color: #2a88df;
}
.editor-colors :not(.editor--private.mini),
:host :not(.editor--private.mini) {
  color: #f0f4ff;
}
.editor .wrap-guide,
:host .wrap-guide {
  background-color: rgba(240, 244, 255, 0.3);
}
.editor .indent-guide,
:host .indent-guide {
  color: #7ab8ff;
}
.editor .invisible,
:host .invisible,
.editor .invisible-character,
:host .invisible-character {
  color: #7ab8ff;
}
.editor .gutter,
:host .gutter {
  background-color: #2180d9;
  color: #bad8ff;
}
.editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: rgba(240, 244, 255, 0.2);
  color: #f0f4ff;
}
.editor .gutter .line-number.git-line-added,
:host .gutter .line-number.git-line-added {
  border-left-color: #93f7a3;
}
.editor .gutter .line-number.git-line-modified,
:host .gutter .line-number.git-line-modified {
  border-left-color: #ffbbf0;
}
.editor .gutter .line-number.git-line-removed:before,
:host .gutter .line-number.git-line-removed:before {
  border-left-color: #ffbbf0;
}
.editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
.editor .gutter .line-number:after,
:host .gutter .line-number:after,
.editor .fold-marker:after,
:host .fold-marker:after {
  color: #f0f4ff;
}
.editor .cursor,
:host .cursor {
  border-left: 2px solid #f0f4ff;
}
.editor .cursor-line,
:host .cursor-line {
  background-color: transparent;
}
.editor .highlight.selection .region,
:host .highlight.selection .region {
  background-color: rgba(240, 244, 255, 0.3);
}
.editor .region.bracket-matcher,
:host .region.bracket-matcher {
  background-color: rgba(240, 244, 255, 0.3);
}
.editor .source,
:host .source {
  color: #f0f4ff;
}
.editor .comment,
:host .comment,
.editor .source.embedded .comment,
:host .source.embedded .comment {
  color: #7ab8ff;
}
.editor .entity,
:host .entity,
.editor .variable,
:host .variable,
.editor .keyword.operator,
:host .keyword.operator {
  color: #f0f4ff;
}
.editor .keyword.control,
:host .keyword.control,
.editor .keyword.other,
:host .keyword.other,
.editor .storage,
:host .storage {
  color: #ffbbf0;
}
.editor .constant,
:host .constant,
.editor .keyword.unit,
:host .keyword.unit,
.editor .string,
:host .string {
  color: #93f7a3;
}
.editor .source .string .source,
:host .source .string .source,
.editor .source .string .meta.embedded.line,
:host .source .string .meta.embedded.line {
  color: #93f7a3;
}
.editor .source .string .punctuation.section.embedded,
:host .source .string .punctuation.section.embedded {
  color: #93f7a3;
}
.editor .source .string .punctuation.section.embedded .source,
:host .source .string .punctuation.section.embedded .source {
  color: #93f7a3;
}
.editor .c.storage.type,
:host .c.storage.type {
  color: #ffbbf0;
}
.editor .coffee.function.support,
:host .coffee.function.support {
  color: #ffbbf0;
}
.editor .coffee.function.support.console,
:host .coffee.function.support.console {
  color: #bad8ff;
}
.editor .coffee.function.storage.type,
:host .coffee.function.storage.type {
  color: #ffbbf0;
}
.editor .css.support.type.property-name,
:host .css.support.type.property-name {
  color: #ffbbf0;
}
.editor .css.pseudo-class,
:host .css.pseudo-class,
.editor .css.entity.name.tag,
:host .css.entity.name.tag {
  color: #bad8ff;
}
.editor .gfm.heading,
:host .gfm.heading {
  color: #ffbbf0;
}
.editor .gfm.comment.quote,
:host .gfm.comment.quote {
  color: #bad8ff;
}
.editor .html.text,
:host .html.text {
  color: #f0f4ff;
}
.editor .html.entity.other.attribute-name,
:host .html.entity.other.attribute-name {
  color: #ffbbf0;
}
.editor .html.meta.tag.doctype,
:host .html.meta.tag.doctype,
.editor .html.entity.name.tag,
:host .html.entity.name.tag,
.editor .html.punctuation.tag,
:host .html.punctuation.tag {
  color: #bad8ff;
}
.editor .java.storage.type,
:host .java.storage.type {
  color: #f0f4ff;
}
.editor .java.storage.type.primitive,
:host .java.storage.type.primitive {
  color: #ffbbf0;
}
.editor .java.storage.modifier.import,
:host .java.storage.modifier.import {
  color: #93f7a3;
}
.editor .less .keyword.operator,
:host .less .keyword.operator {
  color: #f0f4ff;
}
.editor .less .keyword.control.html.elements,
:host .less .keyword.control.html.elements {
  color: #bad8ff;
}
.editor .python.keyword.operator.logical,
:host .python.keyword.operator.logical {
  color: #ffbbf0;
}
.editor .python.keyword.other,
:host .python.keyword.other {
  color: #f0f4ff;
}
.editor .scss.entity.name.tag,
:host .scss.entity.name.tag {
  color: #bad8ff;
}
.editor .scss.property-name,
:host .scss.property-name {
  color: #ffbbf0;
}
